import React from 'react'; // Import the Component component from React
import Markdown from 'react-markdown'
import ReactPlayer from 'react-player'

class PhoneVideo extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      title:props.title,
      text:props.text,
      video:props.video
    }
  }

  render() {
    return(
      <div className="row SectionOne">
        <div className='col-lg-6'>
          <div className='player-wrapper'>
            <ReactPlayer
             className='react-player'
             url='videos/1.mp4'
             playing
             volume={10}
             muted
             loop
             height='600px'
             width='50%'
            />
          </div>
        </div>
        <div className='col-lg-6'>
          <h1 className="sectionOne-title">{this.state.title}</h1>
          <p className="sectionOne-text">{this.state.text}</p>
        </div>
      </div>
    )
  }
}

export default PhoneVideo;
